SET NAMES 'utf8';
SET CHARACTER SET utf8;

CREATE TABLE `subject` (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(255),
  `header_image` LONGTEXT,
  `preview` LONGTEXT,
  `preview_image` LONGTEXT,
  `content` LONGTEXT,
  `content_image` LONGTEXT,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;


INSERT INTO `subject` (`name`, `header_image`, `preview`, `preview_image`, `content`, `content_image`) VALUES
('Expresión Gráfica en la Ingeniería', 'data:image/jpeg;base64,', ' <p>Los estudiantes explorarán desde la representación de figuras básicas hasta la resolución de problemas complejos. Aprenderán técnicas esenciales de representación gráfica, vitales en el ámbito de la ingeniería.</p>\n<ul>\n   <li><strong>Normalización:</strong> Vistas de figuras y metodología. Ejercicios con 30 figuras y soluciones.</li>\n   <li><strong>Sistema Diédrico:</strong> Generalidades, métodos operativos, distancias, ángulos, formas geométricas y desarrollos.</li>\n   <li><strong>Perspectiva Axonométrica:</strong> Isométrica, Caballera, y ejercicios relacionados.</li>\n   <li><strong>Planos Acotados:</strong> Puntos, rectas, planos, acotamientos, dibujo topográfico y geometría plana.</li>\n</ul>', 'data:image/png;base64,', '<h1>Expresión Gráfica en la Ingeniería</h1>\n    <p>Curso diseñado para adquirir los conocimientos necesarios para aprobar la asignatura partiendo de cero.</p>\n\n    <h2>Metodología</h2>\n    <p>Todas nuestras clases han sido grabadas en pizarra, igual que en clases presenciales. Dispondrás de clases de teoría aplicada a los ejercicios y resolución de ejercicios.</p>\n    <ul>\n        <li>En las clases de teoría, toma apuntes y haz esquemas.</li>\n        <li>En las clases de ejercicios, resuélvelos al mismo tiempo que los explica el profesor.</li>\n    </ul>\n    <p><strong>Vídeos de teoría y ejercicios:</strong></p>\n    <ul>\n        <li>Todas las clases explicadas en pizarra, paso a paso (ver ejemplos).</li>\n        <li>Aprende dibujo técnico a tu ritmo.</li>\n    </ul>\n\n    <h2>Tres cursos al año</h2>\n    <p>Puedes incorporarte en cualquier momento.</p>\n    <ul>\n        <li><strong>Inicio:</strong> Primer semestre. 1 de Octubre 2023.</li>\n        <li><strong>Finalización:</strong> Fecha de examen ordinario: Febrero 2024.</li>\n        <li><strong>Inicio:</strong> Primer semestre. 1 de Marzo 2024.</li>\n        <li><strong>Finalización:</strong> Fecha de examen extraordinario: Junio 2024.</li>\n        <li><strong>Inicio:</strong> Curso de verano: 1 de Julio 2024..</li>\n        <li><strong>Finalización:</strong> Fecha de examen: Septiembre 2024.</li>\n    </ul>\n\n    <h2>Precio y forma de pago</h2>\n    <ul>\n        <li><strong>Matrícula gratuita.</strong></li>\n        <li><strong>Precio del curso:</strong> 200€.</li>\n        <li><strong>Forma de pago:</strong>\n            <ul>\n                <li>Ingreso por Transferencia bancaria o Bizum.</li>\n                <li>Ponte en contacto con secretaría: Teléfono y WhatsApp: 699136622.</li></ul></li></ul>\n<h2>Contenido del curso:</h2>\n    <ol>\n        <li>\n            <strong>Normalización.</strong>\n            <ul>\n                <li>Vistas de una figura. Metodología.</li>\n                <li>Ejercicios: 30 figuras y soluciones.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Sistema Diédrico. Generalidades.</strong>\n            <ul>\n                <li>Introducción.</li>\n                <li>El punto, la recta y el plano. Tercera proyección.</li>\n                <li>Punto perteneciente a una recta.</li>\n                <li>Recta perteneciente a un plano.</li>\n                <li>Punto perteneciente a un plano.</li>\n                <li>Definir un plano.</li>\n                <li>Intersección entre dos rectas.</li>\n                <li>Intersección entre dos planos.</li>\n                <li>Intersección entre recta y plano.</li>\n                <li>Intersecciones con los planos bisectores.</li>\n                <li>Paralelismo y perpendicularidad.</li>\n                <li>Ejemplos de paralelismo y perpendicularidad.</li></ul></li><br><li><strong>Sistema Diédrico. Los métodos operativos.</strong>\n            <ul>\n                <li>Abatimiento de un plano oblicuo.</li>\n                <li>Abatimiento por la cota y por afinidad.</li>\n                <li>Ejercicios abatimiento plano oblicuo: 01, 02, 03 y 04.</li>\n                <li>Abatimientos de todos los planos.</li>\n                <li>Ejercicio 05: Abatimiento de un plano paralelo a la LT.</li>\n                <li>Ángulo de trazas de un plano.</li>\n                <li>Cambio de plano.</li>\n                <li>Giros.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Sistema Diédrico. Distancias.</strong>\n            <ul>\n                <li>Distancia entre dos puntos.</li>\n                <li>Distancia de un punto a un plano.</li>\n                <li>Distancia de un punto a una recta.</li>\n                <li>Distancia entre dos planos paralelos.</li>\n                <li>Distancia entre dos rectas paralelas.</li>\n                <li>Distancia entre una recta y un plano paralelos.</li>\n                <li>Distancia entre dos rectas que se cruzan.</li>\n                <li>Ejercicio 06: Distancia entre dos planos.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Sistema Diédrico. Ángulos.</strong>\n            <ul>\n                <li>Introducción.</li>\n                <li>Ángulos que forma una recta dada con los planos de proyección.</li>\n                <li>Dibujar una recta dados los ángulos con el PHP y el PVP.</li>\n                <li>Ejercicio 07.</li>\n                <li>Ángulos que forma un plano con los planos de proyección.</li>\n                <li>Dibujar un plano dados los ángulos con el PHP y el PVP.</li>\n                <li>Ejercicio 08.</li>\n                <li>Ángulo de trazas de un plano.</li>\n                <li>Ángulo entre dos rectas dadas.</li>\n                <li>Ángulo entre dos planos dados.</li>\n                <li>Ángulo entre una recta y un plano dados.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Sistema Diédrico. Formas geométricas.</strong>\n            <ul>\n                <li>Prisma, cilindro, pirámide, cono y esfera.</li>\n                <li>Altura de una figura apoyada en un plano.</li>\n                <li>Ejercicio 09: prisma sobre plano oblicuo.</li>\n                <li>Ejercicio 10: pirámide sobre plano oblicuo.</li>\n                <li>Ejercicio 11: cilindro sobre plano oblicuo.</li>\n                <li>Ejercicio 12: cono sobre plano oblicuo.</li>\n                <li>Intersecciones de planos con superficies radiadas.</li>\n                <li>Teorema de Salch.</li>\n                <li>Intersecciones de rectas con superficies radias.</li>\n                <li>Ejercicio 13: prisma intersección con plano y recta.</li>\n                <li>Ejercicio 14: pirámide intersección con plano y recta.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Sistema Diédrico. Desarrollos.</strong>\n            <ul>\n                <li>Desarrollos, transformada y línea geodésica.</li>\n                <li>Desarrollo de prisma recto y cilindro recto.</li>\n                <li>Desarrollo de prisma y cilindro oblicuo.</li>\n                <li>Desarrollo de pirámide recta y oblicua.</li>\n                <li>Desarrollo de cono recto y oblicuo.</li>\n                <li>Desarrollo de poliedros regulares.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Perspectiva Axonométrica ortogonal y oblicua.</strong>\n            <ul>\n                <li>Axonometría: Isométrica y Caballera.</li>\n                <li>Ejercicio 01: Vistas y acotación. Perspectiva isométrica.</li>\n                <li>Ejercicio 02: Perspectiva Isométrica.</li>\n                <li>Ejercicio 03: Perspectiva caballera.</li>\n                <li>Introducción al sistema axonométrico.</li>\n                <li>Perspectiva caballera en función del ángulo del eje Y.</li>\n                <li>Reducción de los ejes en axonométrico.</li>\n                <li>Punto, recta y plano. Pertenencia.</li>\n                <li>Intersecciones. Traza ordinaria.</li>\n                <li>Paralelismo.</li>\n                <li>Abatimiento de los planos de proyección en trimétrico.</li>\n                <li>Abatimiento de los planos de proyección en caballera.</li>\n                <li>Abatimiento de un plano oblicuo en trimétrico.</li>\n                <li>Abatimiento de un plano oblicuo en caballera.</li>\n                <li>Perpendicularidad.</li>\n                <li>La esfera en sistema axonométrico.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Planos Acotados.</strong>\n            <ul>\n                <li>Introducción. Punto, recta y plano.</li>\n                <li>Pertenencia.</li>\n                <li>Intersecciones.</li>\n                <li>Abatimientos.</li>\n                <li>Trazado de cubiertas. Aleros exteriores.</li>\n                <li>Cubiertas: Alzados y secciones.</li>\n                <li>Cubiertas con patios interiores.</li>\n                <li>Dibujo topográfico. Generalidades.</li>\n                <li>Dibujo topográfico. Plataformas con curvas.</li>\n                <li>Acuerdos cónicos y cilíndricos.</li>\n                <li>Ejercicio de explanaciones.</li>\n            </ul>\n        </li>\n<br>\n        <li>\n            <strong>Geometría plana.</strong>\n            <ul>\n                <li>Triángulos: Nomenclatura y clasificación.</li>\n                <li>Triángulos: Puntos y rectas notables.</li>\n                <li>Polígonos regulares.</li>\n                <li>Polígonos regulares dado el lado.</li>\n                <li>Polígonos regulares dada la circunferencia circunscrita.</li>\n                <li>Curvas cónicas: Elipse, parábola e hipérbola.</li>\n                <li>Elipse. Teoría y ejercicio.</li>\n                <li>Parábola. Teoría y ejercicio.</li>\n                <li>Hipérbola. Teoría y ejercicio.</li>\n                <li>Tangencias. lugares geométricos.</li>\n                <li>Potencia, eje radical y centro radical.</li>\n                <li>Inversión. punto, recta y circunferencia.</li>\n                <li>Tangencias. Los 10 problemas de Apolonio.</li>\n            </ul>\n        </li>\n    </ol>', 'data:image/png;base64,');
